import styled from "styled-components";
import { useSelector, useDispatch } from "react-redux";

const TodoBox = styled.div`
  max-width: 1150px;
  background-color: white;
  margin: auto;
  border: 1px solid transparent;
  border-radius: 10px;
`;

const Todo = () => {
  const todolist = useSelector((state) => state.todolist);
  console.log(todolist);

  return (
    <div>
      <TodoBox>
        {todolist.map((todolists) => {
          <div key={todolists.id}>
            <div>
              <h2>{todolists.title}</h2>
              <span>{todolists.content}</span>
            </div>
            <button>삭제하기</button>
            <button>취소 </button>
          </div>;
        })}
        <div>title</div>
        <div>content</div>
        <button>완료</button>
        <button>삭제</button>
      </TodoBox>
    </div>
  );
};

export default Todo;
